webpackJsonp([0xe37c23f01fe1],{592:function(e,t){e.exports={data:{site:{siteMetadata:{title:"aendrew.com v8",author:"Aendrew Rininsland"}},markdownRemark:{id:"/Users/andrew.rininsland/Projects/OTHER/aendrew.github.io/src/pages/2011-11-18-city-jtech-culjteg-update-notes-nov-14-meeting/index.md absPath of file >>> MarkdownRemark",html:'<p>…Well, maybe next week we’ll have a meeting at the scheduled time?</p>\n<p>Due to Greenslade cancelling his Monday lecture, we bumped up our meeting time to then and had a general discussion. </p>\n<h3>Topics discussed (in no particular order):</h3>\n<ul>\n<li>Does Google Standout matter?</li>\n<li>What does everyone think of iPad/iPhone-only publications like The Daily? </li>\n</ul>\n<h3>Project ideas discussed:</h3>\n<ul>\n<li>iPad/iPhone app</li>\n</ul>\n<h3>New project champions!</h3>\n<ul>\n<li>\n<p>Andrew Stuart: <a href="http://twitter.com/aendrewrstuart">@AndrewRStuart</a></p>\n</li>\n<li>\n<p>Rebecca Ratcliffe <a href="http://twitter.com/#!/r_ratclif">@r_ratclif</a></p>\n<p><em>(A project champion is a member who has stepped forward and said they’ll both attend meetings and retweet information. Thanks to everyone who has volunteered!)</em></p>\n</li>\n</ul>\n<h1>We’re still mostly talking about what we want out of this group and various other logistical aspects. If you’re interested, please join us next week at Saddlers on Monday at 5!</h1>',frontmatter:{title:"City JTech (CULJTEG) Update -- Notes from Nov. 14 meeting",date:"November 18, 2011"}}},pathContext:{path:"content/city-jtech-culjteg-update-notes-nov-14-meeting"}}}});
